import EditButton from "../../../components/buttons/editButton";
import DeleteButton from "../../../components/buttons/deleteButton";

const CurrencyTable = (props) => {
    if ('') {
        return (
            <Table responsive>
                <thead>
                <tr>
                    <th>#</th>
                    <th></th>
                </tr>
                </thead>
                <tbody>

                </tbody>
            </Table>
        )
    } else {
        return (
            <div></div>
        )
    }
}
export default CurrencyTable;
